import React,{ useState }  from "react"
const Count=()=>{
    const state=useState();
    const [countNum,setCount]=useState(0);
    const IncNum=()=>{
        setCount(countNum*1);
    };
    return(
        <>
        <h1 style={{ontSize:"25px",marginTop:"11rem",marginLeft:"10rem"}}>{countNum}</h1>
        <button style={{backgroundColor:"blue",fontSize:"25px",marginTop:"17rem",marginRight:"5rem",border:"2px solid #ecf0f1",outline:"none",borderRadius:"5px",cursor:"pointer"}} 
         onClick={IncNum}>Click Me</button>
        </>
    );
};
export default Count;
